select
	cell_metadata.cell_id,
	anode,
	cathode,
	source,
	ah,
	form_factor,
	tester,
	soc,
	v_init,
	indentor,
	nail_speed
from  
	cell_metadata inner join abuse_metadata on cell_metadata.cell_id = abuse_metadata.cell_id  
where
	soc IN ({{soc}}) and 
	tester in ({{tester}}) and 
	status = 'completed'
order by 
	abuse_metadata.cell_id 